import { Box, chakra, Flex, Text } from "@chakra-ui/react";
import React from "react";

function Sb({ children }) {
  return <chakra.span fontWeight={400}>{children}</chakra.span>;
}

function LightText({ children, last }) {
  return (
    <Text
      fontSize={"md"}
      fontWeight={200}
      pb={last ? 0 : 4}
      pl={4}
      borderLeft={"4px solid rgba(255,255,255,0.5)"}
    >
      {children}
    </Text>
  );
}

function DarkPurpleContainer({ children }) {
  return (
    <Flex
      bg={"rgba(255,255,255,.16)"}
      color={"white"}
      p={4}
      m={2}
      flexGrow={1}
      my={2}
      w={{ base: "100%", lg: "40%" }}
      direction={"column"}
      justifyContent={"space-between"}
    >
      {children}
    </Flex>
  );
}

